import React from 'react';
import {Component} from 'react';
import {connect} from 'react-redux';
import profilePhoto from '../pics/profilePhoto.jpg';
import '../style.css'

class ProfilePopup extends Component{
  render(){
    return(
      <div className="popupWrap">
        <div className="backgroundPopup"></div>
          <div className="popup">
            <div className="popupProfileInfo">
              <img src={profilePhoto} alt=""/>
              <div><h4>rrrr</h4><span>radfasdf</span></div>
            </div>
            <div className="popupMessage">
              <textarea type="text" placeholder="Enter your message"></textarea>
              <button>Sumit</button>
            </div>
          </div>
      </div>
    )
  }
}

export default connect(
  state => ({
    FirstName: state.profile.FirstName,
    SecondName: state.profile.SecondName,
    userInfo: state.profile.AboutMe,
    age: state.profile.age,
    city: state.profile.city
  }),
  dispatch =>({

  })
)(ProfilePopup)
